import React, { Component } from 'react';
import './_css/test.css';


import HomeTest from './Tests/HomeTest.js'
import TimerTest from './Tests/TimerTest.js'
import MountainTest from './Tests/MountainTest.js'

class App extends Component {
  render() {
    return(
      <div>
      	<MountainTest />

      	<div id="one" class="two"></div>
      	<div id="two" class="two"></div>
      	<div id="three" class="two"></div>
      	<div id="four" class="two"></div>
      	<div id="five" class="two"></div>
      	<div id="six" class="two"></div>
      	<div id="seven" class="two"></div>
      	<div id="eight" class="two"></div>

      </div>
    )
  }
}

export default App;
